VALUES ('3184830067031', 'Mini feuilletés apéritifs saumon . épinard-ricotta . roulé saucisse . tomates-legumes', 'Mini feuilletés tomate et légumes 29,7% : Farine de blé (farine de blé, gluten de blé), eau, margarine (graisse de palme, eau, huile de colza, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), purée de tomate mi-réduite 6,8%, courgette 4,5%, préparation à base d\'aubergine 2,7% (aubergine grillée 2,4%,  huile de colza, vinaigre de Xérès, sel, origan, ail, correcteur d\'acidité : acide citrique), double concentré de tomate 2,2%, préparation pour sauce blanche en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), poivron rouge 1,8%, amidon modifié de pomme de terre, sel, sucre, ail déshydraté, lactose et protéines de lait, crème en poudre, oeuf en poudre, poivre, persil déshydraté, basilic déshydraté. Pourcentages exprimés sur le mini feuilleté tomate et légumes. Mini feuilletés épinard et ricotta 29,7% : Farine de blé (farine de blé, gluten de blé), margarine (graisse de palme, eau, huile de colza, sel, émulsifiant: mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), eau, épinard 16,7%, ricotta de vache 15,5% (lactosérum, lait de vache, correcteur d\'acidité : acide citrique), préparation pour sauce blanche en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), oeuf en poudre, roquefort fondu (roquefort, eau, sels de fonte : phosphates de sodium et polyphosphates), sel, lactose et protéines de lait, crème en poudre, poivre. Pourcentages exprimés sur le mini feuilleté épinard et ricotta. Mini feuilletés saucisse 20,8% : Saucisse de Strasbourg 36,3% (viande de porc 29,7%, eau, sel, sucre, extrait d\'épices, conservateur : nitrite de sodium, antioxydant : érythorbate de sodium), farine de blé (farine de blé, gluten de blé), margarine (graisse de palme, eau, huile de colza, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), eau, graines de pavot, sel, lactose et protéines de lait, crème en poudre, œuf en poudre. Pourcentages exprimés sur le mini feuilleté saucisse. Mini feuilletés saumon 19,8% : Farine de blé (farine de blé, gluten de blé), eau, margarine (graisse de palme, eau, huile de colza, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), saumon Atlantique 11%, fromage blanc, amidons modifiés de pomme de terre, oignons rissolés (oignons, huile de tournesol), pulpe de saumon fumé 1,4% (saumon Atlantique, sel), jus de citron à base de concentré (concentré de jus de citron, conservateur : disulfite de sodium), préparation pour sauce blanche en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), pulpe de saumon rose du Pacifique 1,3% (Oncorhynchus gorbuscha), sel, persil, œuf en poudre, lactose et protéines de lait, crème en poudre, aneth déshydratée. Pourcentages exprimés sur le mini feuilleté saumon.  Peut contenir des traces de graines de sésame, moutarde, céleri, mollusques, crustacés et fruits à coque.  Ce produit contient de la saucisse fabriquée à partir de porc d\'origine UE.', 'https://static.openfoodfacts.org/images/products/318/483/006/7031/front_fr.10.400.jpg', '18', '9.4', '28', '1.6', '1.7', '6.3', '0.95', '0.374015748031496', '', '1');

